create table coach_club_team
(
    coach_id          integer
        constraint coach_coach_club_team_fk
            references coach,
    club_id           varchar
        constraint coach_club_team_club_id_fk
            references club,
    club_team_name    varchar,
    start_year        integer not null,
    end_year          integer default 9999,
    coach_wikidata_id varchar
);

alter table coach_club_team
    owner to postgres;

create index coach_club_team_coach_id_idx
    on coach_club_team (coach_id);

create index coach_club_team_end_year_idx
    on coach_club_team (end_year);

create index coach_club_team_start_year_idx
    on coach_club_team (start_year);

grant select on coach_club_team to inode_readonly;

